import DataAccessService from "./path/to/DataAccessService";

const fetchHomes = async () => {
  try {
    const homes = await DataAccessService.listAll();
    return homes;
  } catch (error) {
    console.error("Error fetching homes:", error);
    throw error;
  }
};

const searchHomes = async (searchInput) => {
  try {
    const data = { filter: { address: { _like: `%${searchInput}%` } } };
    const searchResults = await DataAccessService.search(data);
    return searchResults;
  } catch (error) {
    console.error("Error searching homes:", error);
    throw error;
  }
};

export { fetchHomes, searchHomes };
